module.exports = { title: 'Download legacy images',
  category: 'download',
  preText: 'Search our curated library of logos and icons that have been created for previous BHP Projects.\n',
  examples: 
   [ { title: null,
       script: 'import React, { Component } from "react";\nimport DownloadBlock from "../components/DownloadBlock";\nimport downloadFiles from "../components/DownloadBlock/config";\nimport { ThemeSubscriber } from "bhp-ui-react";\n\nexport default class Download extends Component {\n  constructor(props) {\n    super(props);\n    this.themechanged = this.themechanged.bind(this);\n    this.state = {\n      themeName: null\n    };\n  }\n\n  componentDidMount(){\n    ThemeSubscriber.subscribe(this.themechanged);\n  }\n\n  componentWillUnmount() {\n    ThemeSubscriber.unsubscribe(this.themechanged);\n  }\n\n  themechanged(value) {\n    if (value) {\n      this.setState({ themeName: value.name });\n    }\n  }\n  render() {\n    let { themeName } = this.state;\n    return (\n      <div className="d-flex flex-wrap">\n        {themeName &&\n          downloadFiles[themeName] &&\n          downloadFiles[themeName].map(({ name, src }) => (\n            <DownloadBlock key={name} name={name} src={src} />\n          ))}\n      </div>\n    );\n  }\n}\n' } ] }

