module.exports = { title: 'Grid',
  category: 'Foundation',
  preText: 'Our grid uses the Bootstrap grid system with 12 columns and 30px gutter.\n\n##### Columns\n\nTo instantiate a row, simply add a div with the class `row`\n\nWithin the row, adding elements with the classes `col-1` through to `col-12` will create columns that occupy 1/12th through to 12/12th\'s respectively. Any combination of widths can be used, with gutters automatically inserted between.\n\n##### Column Offsets\n\nThe classes `offset-1` through to `offset-11` can be used to offset the current column by 1 to 11 columns respectively.\n\n<div class="alert alert-info" role="alert">\n  <i class="fas fa-info-circle"></i> <strong>Developer note:</strong>\n  Follow the <a href="https://getbootstrap.com/docs/4.0/layout/grid/">Bootstrap documentation on breakpoint classes</a>.\n</div>\n',
  examples: 
   [ { css: '.row {\n  margin-bottom: 10px;\n}\n\n.row .inner {\n  padding: 5px;\n  background-color: #f8f8f8;\n  border: 1px solid #eaeaea;\n}\n\n.dark-theme .row .inner {\n  background-color: #444;\n  border: 1px solid #555;\n}\n',
       html: '<div class="container">\n  <div class="row">\n    <div class="col-3">.col-3</div>\n    <div class="col-3 offset-4">.col-3 .offset-4</div>\n  </div>\n\n  <div class="row">\n    <div class="col-3">.col-3</div>\n    <div class="col-6">.col-6</div>\n    <div class="col-3">.col-3</div>\n  </div>\n\n  <div class="row">\n    <div class="col-1">.col-1</div>\n    <div class="col-11">.col-11</div>\n  </div>\n\n  <div class="row">\n    <div class="col-2">.col-2</div>\n    <div class="col-10">.col-10</div>\n  </div>\n\n  <div class="row">\n    <div class="col-3">.col-3</div>\n    <div class="col-9">.col-9</div>\n  </div>\n\n  <div class="row">\n    <div class="col-4">.col-4</div>\n    <div class="col-8">.col-8</div>\n  </div>\n\n  <div class="row">\n    <div class="col-5">.col-5</div>\n    <div class="col-7">.col-7</div>\n  </div>\n\n  <div class="row">\n    <div class="col-6">.col-6</div>\n    <div class="col-6">.col-6</div>\n  </div>\n</div>\n' } ] }

