module.exports = { title: 'Date picker',
  category: 'UI components',
  preText: 'A date picker is used to select a single date in an application. The selected\nday is indicated by a filled square. The current day is indicated by a\ndifferent font weight (bold).\n\nYou must initialise your app with `import \'react-dates/initialize\';` to use\nthis component.\n',
  examples: 
   [ { title: 'Usage',
       introduction: 'Below is an example of the date picker, click in the input to see the\ndate picker dropdown.\n',
       subTitle: 'Example',
       react: 'import React from \'react\';\nimport moment from \'moment\';\nimport { SingleDatePicker } from \'react-dates\';\nimport "react-dates/initialize";\n\n\nexport default class Example extends React.Component {\n  constructor(props) {\n    super(props);\n    this.state = {\n      date: moment(),\n      focused: false\n    };\n  }\n\n  render() {\n    return (\n      <div>\n        <SingleDatePicker\n          date={this.state.date}\n          onDateChange={date => this.setState({ date })}\n          focused={this.state.focused}\n          numberOfMonths={1}\n          onFocusChange={({ focused }) => this.setState({ focused })}\n          hideKeyboardShortcutsPanel\n          customInputIcon={<i className="fas fa-calendar-alt md-18 align-middle"></i>}\n        />\n      </div>\n    );\n  }\n}\n',
       'angular-hide': 'import { Component } from "@angular/core";\n@Component({\n  selector: "example",\n  template: `\n    <label>\n      Date\n      <input [owlDateTimeTrigger]="dt3" [owlDateTime]="dt3">\n      <owl-date-time [pickerType]="\'calendar\'" #dt3></owl-date-time>\n    </label>`\n})\nexport class Example {}\n' } ] }

