module.exports = { title: 'Input',
  category: 'UI components',
  preText: 'Provides a simple, standardized input component which enforces the BHP styling. The input will allow the ability to show a tooltip next to the label and more importantly display any validation errors with the BHP styling. Text fields typically reside in forms but can appear in other places, like dialog boxes and search. Text fields validate input, help users fix errors, autocomplete words, and provide suggestions. They are generally single-line inputs.\n',
  examples: 
   [ { title: 'Text input',
       introduction: 'Bootstrap supports all the HTML5 input types: text, password, datetime, datetime-local, date, month, time, week, number, email, url, search, tel, and color.\n',
       subTitle: 'Example',
       react: 'import React from \'react\';\nimport { Button, Form, FormGroup, Label, Input, FormText } from \'reactstrap\';\n\nexport default () => (\n  <FormGroup>\n    <Label for="exampleInput1">Default text input</Label>\n    <Input type="text" id="exampleInput1" placeholder="Enter text" />\n  </FormGroup>\n);\n',
       html: '<div class="form-group">\n  <label for="exampleInput1">Default text input</label>\n  <input type="text" class="form-control" id="exampleInput1" placeholder="Enter text">\n</div>\n',
       angular: 'import { Component } from "@angular/core";\nimport { FormsModule } from "@angular/forms";\nimport { CommonModule } from "@angular/common";\n@Component({\n  selector: "example",\n  template: `\n    <div class="form-group">\n      <label for="exampleInput1">Default text input</label>\n      <input [(ngModel)]="input" type="text" class="form-control" id="exampleInput1" placeholder="Enter text">\n    </div>\n    <div>Text is: {{input}}</div>`\n})\nexport class Example {}\n' },
     { title: 'Variations',
       subTitle: 'Example',
       react: 'import React from \'react\';\nimport { Button, Form, FormGroup, Label, Input, FormText, FormFeedback } from \'reactstrap\';\n\nexport default () => (\n  <div>\n    <FormGroup>\n      <Label for="exampleInput2">Default text input</Label>\n      <Input\n        type="text"\n        id="exampleInput2"\n        placeholder="Enter text"\n      />\n    </FormGroup>\n    <FormGroup>\n      <Label for="exampleInput3">Disabled</Label>\n      <Input\n        type="text"\n        id="exampleInput4"\n        placeholder="Enter text"\n        disabled\n      />\n    </FormGroup>\n    <FormGroup>\n      <Label for="exampleInput3">Text input with an error</Label>\n      <Input\n        type="text"\n        id="exampleInput4"\n        placeholder="Enter text"\n        valid={false}\n      />\n      <FormFeedback>\n        This is a system message.\n      </FormFeedback>\n    </FormGroup>\n  </div>\n);\n',
       html: '<div class="form-group">\n  <label for="exampleInput2">Default text input</label>\n  <input\n    type="text"\n    class="form-control"\n    id="exampleInput2"\n    placeholder="Enter text"\n  />\n</div>\n<div class="form-group">\n  <label for="exampleInput3">Disabled</label>\n  <input\n    type="text"\n    class="form-control"\n    id="exampleInput4"\n    placeholder="Enter text"\n    disabled\n  />\n</div>\n<div class="form-group">\n  <label for="exampleInput3">Text input with an error</label>\n  <input\n    type="text"\n    class="form-control is-invalid"\n    id="exampleInput4"\n    placeholder="Enter text"\n  />\n  <div class="invalid-feedback">\n    This is a system message.\n  </div>\n</div>\n',
       angular: 'import { Component } from "@angular/core";\nimport { FormsModule } from "@angular/forms";\nimport { CommonModule } from "@angular/common";\n@Component({\n  selector: "example",\n  template: `\n  <div class="form-group">\n    <div class="form-group">\n      <label for="exampleInput2">Default text input</label>\n      <input [(ngModel)]="input" type="text" class="form-control" id="exampleInput2" placeholder="Enter text" />\n      <div>Text is: {{input}}</div>\n    </div>\n    <div class="form-group">\n      <label for="exampleInput3">Disabled</label>\n      <input [(ngModel)]="inputDisable" type="text" class="form-control" id="exampleInput4" placeholder="Enter text" disabled />\n    </div>\n    <div class="form-group">\n      <label for="exampleInput3">Text input with an error</label>\n      <input [(ngModel)]="inputError" type="text" class="form-control" [ngClass]="{\'is-invalid\': !inputError || inputError.length <= 0}" id="exampleInput4" placeholder="Enter text" />\n      <div *ngIf="!inputError || inputError.length <= 0" class="invalid-feedback">\n        This is a system message.\n      </div>\n      <div>Text is: {{inputError}} </div>\n    </div>\n  </div>`\n})\nexport class Example {}\n' } ] }

