       subTitle: 'Example',
       react: 'import React from \'react\';\nimport { lightTheme } from \'bhp-ui-react\';\nimport { BHPLogo } from \'bhp-ui-react\';\nimport colors from "../styles/export-colors.css"\n\nexport default () => {\n  return (\n    <div className=\'d-flex\'>\n      <BHPLogo className=\'m-2\' />\n      <BHPLogo className=\'m-2\' color=\'black\' />\n      <BHPLogo className=\'m-2\' color={colors["gray-500"]} />\n      <div className=\'p-2 bg-primary\'>\n        <BHPLogo className=\'align-middle\' color=\'white\' />\n      </div>\n    </div>\n  );\n};\n',
       css: '/* export-colors.css\n * use this scss code to generate css file to\n * make sure colors are synchronized from bhp-ui lib.\n\n@import "bhp-ui/scss/do-not-change/colours_reset";\n@import "bhp-ui/scss/themes/shared-colors";\n@import "bhp-ui/scss/themes/dark/_dark-colors.scss";\n@import "bhp-ui/scss/themes/light/_light-colors.scss";\n@import "bhp-ui/scss/themes/warm/_warm-colors.scss";\n\n:export {\n  @each $item in $bhp-colors {\n   #{nth($item, 1)}: #{nth($item, 2)};\n  }\n  @each $item in $theme-colors {\n    #{nth($item, 1)}: #{nth($item, 2)};\n  }\n  @each $item in $colors {\n    #{nth($item, 1)}: #{nth($item, 2)};\n  }\n  @each $item in $grays {\n    gray-#{nth($item, 1)}: #{nth($item, 2)};\n  }\n}\n*/\n',
