       css: '.container-main {\n  display: flex;\n  flex-direction: row;\n  position: relative;\n  overflow: hidden;\n  height: 400px;\n}\n\n.container-sidebar {\n  width: 250px;\n}\n\n.sidebar {\n  left: 0;\n  height: 100%;\n  width: 100%;\n  overflow: auto;\n  background-color: white;\n  transition: left 0.3s ease-out;\n}\n\n.container-body {\n  flex: 1;\n}\n\n\n.entry {\n  .link {\n    position: relative;\n    display: block;\n    border-left: 5px solid transparent;\n    padding: 16px 16px 16px 45px;\n    font-size: 13px;\n    color: #7c7c7c;\n    text-decoration: none;\n    user-select: none;\n    cursor: pointer;\n\n    &:hover {\n      color: #9c9c9c;\n      background-color: #565656;\n      text-decoration: none;\n    }\n\n    .link-icon {\n      position: absolute;\n      left: 15px;\n      font-size: 18px;\n    }\n\n    .toggle {\n      position: absolute;\n      font-size: 18px;\n      top: 15px;\n      right: 5px;\n    }\n  }\n\n  .active-link {\n    color: white;\n\n    &:hover {\n      color: white;\n    }\n  }\n}\n\n/*open below line to enable media query*/\n/*@media screen and (max-width: 768px) {*/\n.container-sidebar {\n  position: absolute;\n  width: 0;\n  height: 100%;\n}\n.container-sidebar.sidebar-show {\n  width: 100%;\n  height: 100%;\n}\n\n.sidebar {\n  position: absolute;\n  left: -250px;\n  width: 250px;\n}\n\n.sidebar-show .sidebar {\n  left: 0;\n}\n.sidebar-backdrop {\n  position: absolute;\n  left: 0;\n  right: 0;\n  top: 0;\n  bottom: 0;\n  background-color: rgba(0, 0, 0, 0.35);\n}\n/*}*/\n',
